if(countSecond < 10){
    <p>Count menshe 10</p>
} else {
    <p>Count bilshe 10</p>
}

    return(
        <>
        <p>{countThird}</p>

        <button onClick={() => setCountThird(countThird + 1)}>
          +
        </button>
          <button onClick={() => setCountThird(countThird - 1)}>
          -
        </button>

        </>
    )
}


export default Component1
